- input: "TEXT\x1CC00468447\x1C.TEXT\x1C\x1CF3XN\x1CThe below were discussed with
    FEC analyst to insure proper compliance:  (1)  On 01/14/10, a transaction was
    accidentally made on the PAC bank card by an employee for $3,000 (Enterprise car
    rental) that was a personal expense not related to the PAC.  Error was promptly
    discovered by employee and a $3000 deposit made to reimburse same day.  The disbursement
    is on line 29, reimbursement on line 15.  (2) an online donor (EDWARD PYERS) accidentally
    donated $5,000, intending to donate $25, via 3rd party processor.  Donor contacted
    processor to report error and arrange refund, which was issued effective in the
    subsequent reporting period and will appear on next report.  In this period, donor
    is listed making a contribution of $5,000 on 01/06/10.  Additionally, due to the
    manner in which online processor reports transactions to the PAC, the contribution
    was recorded as $25 and not $5,000.  A subsequent donation of $25 on 01/15/10
    was accepted, bringing donors actual aggregate amount to $50, but his reported
    aggregate in this reporting period to $5025. (3)  PAC exceeded the aggregate contribution
    limit to a candidate committee, contributing $5000 (using the multi-candidate
    limit).  PAC notified candidate committee which issued a refund of $2600 which
    was recieved and will be reported in the next reporting period.\n"
