      the PAC.  Error was promptly discovered by employee and a $3000 deposit made
      to reimburse same day.  The disbursement is on line 29, reimbursement on line
      15.  (2) an online donor (EDWARD PYERS) accidentally donated $5,000, intending
      to donate $25, via 3rd party processor.  Donor contacted processor to report
